import React from 'react'
import * as FaIcons from 'react-icons/fa' 

export const NavigationData = [
    {
        title: 'Dashboard',
        path: '/',
        icon: <FaIcons.FaHome />
    },
    {
        title: 'Reports',
        path: '/reports',
        icon: <FaIcons.FaUsers />
    }
]
